import React from 'react';

const player = (props) => {
    return (
        <div className="player">
            <p className="name">{props.name}</p>
            <img src={props.srcAvatar} alt="Avatar" className="avatar" />
            <div className="Bet">
                <img src="/src/poker.svg" alt="Bet" />
                {props.bet}
            </div>
            <div className="card">
                <img src={require('/Temporary Work/Project/react-vietnamese-poker/src/Player/gaming.png')} alt="Cards" />
                {props.card}
            </div>
            <div className="score">{props.scrore}</div>
        </div>
    )
}

export default player;
